  `code` varchar(200) DEFAULT NULL COMMENT '代码',
  `remark` text COMMENT '描述',
  `version` varchar(500) DEFAULT NULL COMMENT '版本号',
  `parent_id` int(11) DEFAULT NULL COMMENT '父节点id',
