  `email` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `tel` varchar(100) DEFAULT NULL COMMENT '电话',
  `status` tinyint(1) DEFAULT '1' COMMENT '0：禁用，1：启用',
  `creator` varchar(100) DEFAULT NULL COMMENT '创建者',
