-- ----------------------------
-- Table structure for zw_sys_role
-- ----------------------------
DROP TABLE IF EXISTS `zw_sys_role`;
CREATE TABLE `zw_sys_role` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '角色id',
  `role_id` varchar(255) NOT NULL COMMENT '角色编号',
  `org_id` bigint(20) NOT NULL DEFAULT '-1' COMMENT '组织编号',
  `role_name` varchar(100) NOT NULL COMMENT '角色名称',
  `role_code` varchar(100) DEFAULT NULL COMMENT '角色代号',
  `role_desc` varchar(100) DEFAULT NULL COMMENT '角色描述',
  `author` varchar(100) DEFAULT NULL COMMENT '创建者',
  `birth` datetime DEFAULT NULL COMMENT '创建时间',
  `status` tinyint(1) DEFAULT '1' COMMENT '-1删除0禁用1启用',
  `name` varchar(32) NOT NULL DEFAULT '0' COMMENT '角色名称',
  `sign` varchar(30) DEFAULT NULL COMMENT '角色标识,程序中判断使用,如"admin"',
  `is_delete` int(1) NOT NULL DEFAULT '0' COMMENT '删除标识',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(64) DEFAULT '0' COMMENT '创建人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `update_by` varchar(64) DEFAULT '0' COMMENT '更新人',
  `remark` varchar(256) DEFAULT NULL COMMENT '角色描述',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_sign` (`sign`) USING BTREE,
  KEY `idx_role_id` (`role_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='角色表';

