-- ----------------------------
-- Table structure for zw_sys_user
-- ----------------------------
DROP TABLE IF EXISTS `zw_sys_user`;
CREATE TABLE `zw_sys_user` (
  `user_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `org_id` bigint(20) NOT NULL COMMENT '组织编号',
  `employee_id` varchar(255) DEFAULT NULL COMMENT '员工编号',
  `account` varchar(100) NOT NULL COMMENT '账户（手机或者邮箱）',
  `password` varchar(100) NOT NULL COMMENT '密码',
  `true_name` varchar(100) DEFAULT NULL,
  `nick_name` varchar(100) DEFAULT NULL COMMENT '昵称',
  `sex` int(1) DEFAULT '1' COMMENT '1:男   0:女',
  `email` varchar(100) DEFAULT NULL COMMENT '电子邮箱',
  `tel` varchar(100) DEFAULT NULL COMMENT '手机号',
  `qq` varchar(100) DEFAULT NULL COMMENT 'qq',
  `latest_time` datetime DEFAULT NULL COMMENT '最后登录时间',
  `latest_ip` varchar(100) DEFAULT NULL COMMENT '最后登录ip',
  `status` int(2) DEFAULT '1' COMMENT '0禁用，1启用,-1假删',
  `birth` datetime DEFAULT NULL COMMENT '创建时间',
  `creator` varchar(100) DEFAULT NULL COMMENT '创建者',
  `error_count` int(2) NOT NULL DEFAULT '0' COMMENT '当天登录错误次数',
  `is_lock` int(1) NOT NULL DEFAULT '1' COMMENT '用户是否锁定,0false,1true,1启用,0停用',
  `is_delete` int(1) NOT NULL COMMENT '软删除标识',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新人',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

